import React, { Component } from "react";
import Menu from "../../menu/menu";

export default class MainFunction extends Component {


    render(){
        return (
            <div className="main">
                <div class="menu">
                    <Menu />
                </div>
                <div className="mainDiv">
                    MainFunction
                </div>
            </div>

        )
    }
}
